import styled from "styled-components";
import { useSelector } from "react-redux";

import { ComponentHeaderAuth, ComponentPassword } from "@components";
import { selectMerchant } from "@redux";

export const PageResetPassword = () => {
    //page variable
    const merchant = useSelector(selectMerchant);

    return (
        <StyledContainer color={merchant.themeColor}>
            <ComponentHeaderAuth />
            <ComponentPassword />
        </StyledContainer>
    );
};

const StyledContainer = styled.div<{ color: string }>``;
